import React from 'react';
import './CircularSkillBar.css';

const CircularSkillBar = ({ percentage, text }) => {
  return (
    <div class="container"> 
        <div class="ui-widgets"> 
            <div class="ui-values">85%</div> 
            <div class="ui-labels">Java</div> 
        </div> 
  
        <div class="ui-widgets"> 
            <div class="ui-values">50%</div> 
            <div class="ui-labels">HTML</div> 
        </div> 
    </div> 
  );
};

export default CircularSkillBar;
